import React from 'react';
import './App.css';
import Auth from './Auth';
import Registration from './Registration';


function App() {
  return (
    <div className = 'btn-block'>
      <button className = 'btn' onClick = {()=><Auth/>}>Login</button>
      <Link to="/account">
                <Button color="white" className="is-rounded">
                  <span>My Account</span>
                </Button>
              </Link>
      <button className = 'btn' onClick = {()=><Registration/>}>Sign up</button>
    </div>
  );
}

export default App;
